import React from "react";
import { View, Image,Text } from "react-native";

export default function AppbarGlobal() {
  return (
    <View>
      <Image
       source={{
        uri: 'https://reactnative.dev/img/tiny_logo.png',
      }}
      />
      <Text>Hiii</Text>
    </View>
  );
}
